import React from 'react';
import { Link } from 'react-router-dom';

function MywishPage() { // 함수 이름과 h1 태그 내용 수정
  return (
    <div>
      <h1>마이페이지 - 보고싶은 영화</h1>
      <nav>
        <ul>
          <li><Link to="/my/watched">이미 본 영화</Link></li>
          <li><Link to="/my/wishlist">보고싶은 영화</Link></li>
          <li><Link to="/my/calendar">moviely 캘린더</Link></li>
        </ul>
      </nav>
    </div>
  );
}

export default MywishPage; // export 문 수정
